      "html_content": "<meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\"><meta name=\"viewport\" content=\"width=device-width, initial-scale=1, maximum-scale=1, user-scalable=no\"><meta http-equiv=\"cache-control\" content=\"no-cache\"><meta http-equiv=\"pragram\" content=\"no-cache\"><link rel=\"stylesheet\" type=\"text/css\" href=\"https://cs.ccmtv.cn/upload_files/new_upload_files/ccmtvtp/Public/medicalscales/css/scale_index.css\"><link rel=\"stylesheet\" type=\"text/css\" href=\"https://cs.ccmtv.cn/upload_files/new_upload_files/ccmtvtp/Public/medicalscales/css/base.css\"><link rel=\"stylesheet\" href=\"https://cs.ccmtv.cn/upload_files/new_upload_files/ccmtvtp/Public/css/bootstrap.min.css\"><script src=\"https://cs.ccmtv.cn/upload_files/new_upload_files/ccmtvtp/Public/js/jquery-1.11.1.js\"></script><script type=\"text/javascript\" src=\"https://cs.ccmtv.cn/upload_files/new_upload_files/ccmtvtp/Public/medicalscales/js/global.js\"></script><div class=\"f_page_cont_nav\" id=\"id_f_page_cont_nav\" style=\"min-height: 790px;\">\r\n\t        <div class=\"f_detail_box\">\r\n\t        <div id=\"post-347\" class=\"post\">\r\n\t<div id=\"meta\">\r\n\t\t<select id=\"units\" style=\"display: none;\">\r\n\t\t\t<option value=\"si\" name=\"si\" selected=\"selected\">SI</option>\r\n\t\t\t<option value=\"us\" name=\"us\">US</option>\r\n\t\t</select>\t\r\n\t</div><!--#meta-->\r\n\t<form name=\"theform\" action=\"get\" id=\"theform\">\r\n\t\t<table cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n\t\t<tbody>\r\n\t\t<tr>\r\n\t\t\t\t<td valign=\"top\" colspan=2 > AHA提出了“生命8要素（Life's Essential 8）”，包括饮食、体力活动、戒烟（尼古丁暴露）、睡眠健康、BMI、血脂、血糖和血压。这里针对年龄≥20岁的成人进行评估</td>\r\n\t\t\t</tr>\r\n\r\n\t\t<tr class=\"req\"><td valign=\"top\" class=\"\">您的性别 </td>\r\n\t\t<td class=\"\"><ul>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"0\" name=\"item12\" > 男</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"1\" name=\"item12\" > 女</label></li>\r\n\t\t</ul></td>\r\n\t\t</tr>\r\n\t\t<tr class=\"req\">\r\n\t\t<td valign=\"top\" class=\"\">1.DASH饮食得分（详细见：<a href=\"https://m.medsci.cn/scale/show.do?id=86e23e49d6\" target=\"_blank\">进入评测</a>）</td>\r\n\t\t<td class=\"texthover\"><ul>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"100\" name=\"item1\" > 15-16分</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"80\" name=\"item1\" > 12-14分</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"50\" name=\"item1\" > 8-11分</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"25\" name=\"item1\" > 4-7分</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"0\" name=\"item1\" > 0-3分</label></li>\r\n\t\t</ul>\r\n\t\t</td>\r\n\t\t\r\n\t\t</tr>\r\n\t\t\r\n\t\t<tr class=\"req\">\r\n\t\t<td valign=\"top\" class=\"\">2.每周中高强度运动锻炼时间（分钟）</td>\r\n\t\t<td class=\"\"><ul>\r\n\t\t\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"100\" name=\"item2\" > >=150分钟</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"90\" name=\"item2\" > 120-149分钟</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"80\" name=\"item2\" > 90-119分钟</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"60\" name=\"item2\" > 60-89分钟</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"40\" name=\"item2\" > 30-59分钟</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"20\" name=\"item2\" > 1-29分钟</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"0\" name=\"item2\" > 0分钟</label></li>\r\n\t\t</ul></td>\r\n\t\t</tr>\r\n\t\t\r\n\t\t<tr class=\"req\">\r\n\t\t<td valign=\"top\" class=\"\">3.吸烟情况</td>\r\n\t\t<td class=\"\"><ul>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"100\" name=\"item3\" > 从来不吸烟</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"75\" name=\"item3\" > 以前吸烟，现在戒烟>=5年</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"50\" name=\"item3\" > 以前吸烟，戒烟1-5年内</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"25\" name=\"item3\" > 以前吸烟，戒烟小于1年</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"0\" name=\"item3\" > 当前还在吸烟</label></li>\r\n\t\t</ul></td>\r\n\t\t</tr>\r\n\t\t\r\n\t\t<tr class=\"req\">\r\n\t\t<td valign=\"top\" class=\"\">3.1.家里其他人吸烟情况</td>\r\n\t\t<td class=\"\"><ul>\r\n\t\t\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"0\" name=\"item4\" > 没有</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"-20\" name=\"item4\" > 有</label></li>\r\n\t\t</ul></td>\r\n\t\t</tr>\r\n\t\t\r\n\t\t<tr class=\"req\">\r\n\t\t<td valign=\"top\" class=\"\">4.睡眠情况 </td>\r\n\t\t<td class=\"\"><ul>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"100\" name=\"item5\" > 7–<9小时</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"90\" name=\"item5\" > 9–<10小时</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"70\" name=\"item5\" > 6–<7小时</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"40\" name=\"item5\" > 5–<6小时 或 ≥10小时</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"20\" name=\"item5\" > 4–<5小时</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"0\" name=\"item5\" > <4小时</label></li>\r\n\t\t\r\n\t\t</ul></td>\r\n\t\t</tr>\r\n\t\t\r\n\t\t<tr class=\"req\">\r\n\t\t<td valign=\"top\" class=\"\">5.体重指数（BMI） (kg/m<sup>2</sup>sup>)</td>\r\n\t\t<td class=\"\"><ul>\r\n\t\t\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"100\" name=\"item6\" > <25</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"70\" name=\"item6\" > 25.0–29.9</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"30\" name=\"item6\" > 30.0–34.9</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"15\" name=\"item6\" > 35.0–39.9</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"0\" name=\"item6\" > ≥40.0</label></li>\r\n\t\t</ul></td>\r\n\t\t</tr>\r\n\t\t\r\n\t\t<tr class=\"req\">\r\n\t\t<td valign=\"top\" class=\"\">6.血脂水平（非高密度脂蛋白胆固醇） (mg/dL)</td>\r\n\t\t<td class=\"\"><ul>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"100\" name=\"item7\" > <130</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"60\" name=\"item7\" > 130–159</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"40\" name=\"item7\" > 160–189</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"20\" name=\"item7\" > 190–219</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"0\" name=\"item7\" > ≥220</label></li>\r\n\t\t\r\n\t\t</ul></td>\r\n\t\t</tr>\r\n\t\t<tr class=\"req\">\r\n\t\t<td valign=\"top\" class=\"\">6.1.上述血脂水平，是否使用降脂药物？ </td>\r\n\t\t<td class=\"\"><ul>\r\n\t\t\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"0\" name=\"item8\" > 没有</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"-20\" name=\"item8\" > 有</label></li>\r\n\r\n\t\t</ul></td>\r\n\t\t</tr>\r\n\t\t\t\t<tr class=\"req\">\r\n\t\t<td valign=\"top\" class=\"\">7.空腹血糖(mg/dL) 或HbA1c（%）水平</td>\r\n\t\t<td class=\"\"><ul>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"100\" name=\"item9\" > 无糖尿病史且空腹血糖<100 (或HbA1c <5.7)</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"60\" name=\"item9\" > 无糖尿病，且空腹血糖100–125 (或HbA1c 5.7–6.4) (糖尿病前期)</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"40\" name=\"item9\" > 糖尿病且HbA1c <7.0</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"30\" name=\"item9\" > 糖尿病且HbA1c 7.0–7.9</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"20\" name=\"item9\" > 糖尿病且HbA1c 8.0–8.9</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"10\" name=\"item9\" > 糖尿病且HbA1c 9.0–9.9</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"0\" name=\"item9\" > 糖尿病且HbA1c ≥10.0</label></li>\r\n\t\t\r\n\t\t</ul></td>\r\n\t\t</tr>\r\n\t\t<tr class=\"req\"><td valign=\"top\" class=\"\">8.血压水平(mmHg)</td>\r\n\t\t<td class=\"\"><ul>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"0\" name=\"item10\" > 收缩压<120/舒张压<80</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"1\" name=\"item10\" > 收缩压120–129/舒张压<80</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"2\" name=\"item10\" > 收缩压130–139或舒张压80–89（1度高血压）</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"3\" name=\"item10\" > 收缩压140–159或舒张压90–99</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"3\" name=\"item10\" > 收缩压≥160或舒张压≥100</label></li>\r\n\r\n\t\t</ul></td>\r\n\t\t</tr>\r\n\t\t<tr class=\"req\"><td valign=\"top\" class=\"\">8.1.上述血压水平是否使用降压药物治疗？ </td>\r\n\t\t<td class=\"\"><ul>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"0\" name=\"item11\" > 没有</label></li>\r\n\t\t<li class=\"\"><label><input type=\"radio\" value=\"-20\" name=\"item11\" > 有</label></li>\r\n\t\t\r\n\r\n\t\t</ul></td>\r\n\t\t</tr>\r\n\r\n\t\t<tr class=\"answer\">\r\n\t\t\t\t<td>得分:</td>\r\n\t\t\t\t<td><input type=\"text\" readonly=\"readonly\" value=\"点击查看\" name=\"result\" id=\"result\"></td>\r\n\t\t</tr>\r\n\t\t<tr class=\"answer\">\r\n\t\t\t\t<td>心血管健康分级:</td>\r\n\t\t\t\t<td><input type=\"text\" readonly=\"readonly\" value=\"点击查看\" name=\"result2\" id=\"result2\"></td>\r\n\t\t</tr>\r\n\t\t<tr class=\"answer\">\r\n\t\t\t\t<td>无疾病年:</td>\r\n\t\t\t\t<td><input type=\"text\" readonly=\"readonly\" value=\"点击查看\" name=\"result3\" id=\"result3\"></td>\r\n\t\t</tr>\r\n\r\n\t\t\t\r\n\t\t<tr class=\"answer\">\r\n\t\t\t\t<td colspan=\"2\"><div id=\"resultmsg\"> </div></td>\r\n\t\t</tr>\r\n\t\t<tr class=\"answer\">\r\n\t\t\t\t<td colspan=\"2\">* 无疾病年，指的是在50岁时，还能保持多少年没有心血管疾病<br>\r\n\t\t\t\t心血管健康指的是心血管疾病、糖尿病、癌症和痴呆这四大类疾病<br>\r\n\t\t\t参考文献：Circulation . 2022 Aug 2;146(5):e18-e43.</td>\r\n\t\t</tr>\r\n\r\n\t\t\r\n\t\t</tbody></table>\r\n\t</form>\r\n</div>   \r\n\t        </div>\r\n        </div>    </div>",
